import React from "react";
import memory from './memory.js';
import './memory.css'
import styled from "styled-components";




function Memory() {

return(
    <div className="memory">
        <h2 className="memoryTitle">Конфигурация памяти: 128gb</h2>
        <div className="memoryRow" key = {memory.toString}>
            {memory.map((gigabyte) => (
            <a href={gigabyte.link} className="memoryGigabytes"><span className="memoryFont">{gigabyte.number}</span></a>
            ))}
        </div>
    </div>
    );
}

export default Memory
